script: |
  super -f text -I q6920.spq | sort > q6920.out

inputs:
  - name: q6920.spq
    data: |
      SELECT ALL - ( + + 32 ) AS col0 FROM tab0 (FORMAT parquet) WHERE NOT 71 * - + col1 / - col1 + - - 83 IS NULL;
  - name: tab0

outputs:
  - name: q6920.out
    data: |
      -32
      -32
      -32
